/*Table structure for table `log_follows` */

DROP TABLE IF EXISTS `log_follows`;

CREATE TABLE `log_follows` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) DEFAULT NULL COMMENT 'Mã order',
  `before_status` int(2) DEFAULT NULL COMMENT 'Trạng thái trước',
  `after_status` int(2) DEFAULT NULL COMMENT 'Trạng thái sau',
  `receiver_id` int(11) DEFAULT NULL COMMENT 'Id người được chuyển tiếp, có thể là Sale, là Admin, là Editor, là QA',
  `summary` varchar(255) DEFAULT NULL COMMENT 'Nội dung tóm tắt',
  `content` text DEFAULT NULL COMMENT 'Nội dung chi tiết',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=155 DEFAULT CHARSET=utf8mb4;

