/*Table structure for table `messages` */

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL COMMENT 'ID của đơn hàng',
  `customer_id` int(11) DEFAULT NULL COMMENT 'Id KH lấy ở bảng users',
  `sale_id` int(11) DEFAULT NULL COMMENT 'ID của Sale, người chat với KH',
  `type` varchar(20) DEFAULT 'TEXT' COMMENT 'Kiểu chat: TEXT - chữ, ICON, LINK - Đường dẫn, IMAGE - Hình ảnh, FILE - Tài liệu',
  `content` text DEFAULT NULL COMMENT 'Nội dung chat',
  `file_name` varchar(100) DEFAULT NULL COMMENT 'tên file',
  `status` tinyint(1) DEFAULT 1 COMMENT 'Trạng thái: 0 - Thu hồi, 1 - Hiển thị, 2 - Chỉnh sửa, 3 - Xóa',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8mb4;

/*Data for the table `messages` */

insert  into `messages`(`id`,`order_id`,`customer_id`,`sale_id`,`type`,`content`,`file_name`,`status`,`created_at`,`updated_at`) values (1,3,1,2,'TEXT','133 files\r\nTurn on the lights  with the layers I provide, less ambient influence in the photos, I tend to mostly like the ambient to be blended into the ceilings and floors\r\nstyle trắng sạch, thêm đèn, thêm độ sắc nét, dùng less ambient shots, chủ yếu ở trần và sàn.\r\ntham khao: https://www.dropbox.com/sh/oj50skfwj30xcg5/AACcFlO60OeY5gxGutSIwSD-a?dl=0',NULL,1,'2021-09-23 11:45:10','2021-09-23 11:45:10'),(2,4,1,2,'TEXT','test',NULL,1,'2021-09-23 11:45:16','2021-09-23 11:45:16'),(3,4,NULL,2,'TEXT','Hi',NULL,1,'2021-09-23 11:56:51','2021-09-23 11:56:51'),(4,4,1,NULL,'TEXT','hi',NULL,1,'2021-09-23 12:02:46','2021-09-23 12:02:46'),(5,4,NULL,2,'IMAGE','uploads/message/2021/09/media_1632422739_4.png','ngoc-hac.png',1,'2021-09-24 01:45:39','2021-09-24 01:45:39'),(6,4,NULL,2,'FILE','uploads/message/2021/09/file_1632422759_4.pdf','MXV83 - Chứng nhận TVKD DCV.pdf',1,'2021-09-24 01:45:59','2021-09-24 01:45:59'),(7,4,NULL,2,'LINK','https://www.w3schools.com/jsref/jsref_substring.asp',NULL,1,'2021-09-24 01:46:05','2021-09-24 01:46:05'),(8,5,12,9,'TEXT','fix kích cỡ',NULL,1,'2021-09-25 17:30:38','2021-09-25 17:30:38'),(11,5,12,NULL,'TEXT','a',NULL,1,'2021-09-25 20:42:41','2021-09-25 20:42:41'),(12,5,NULL,9,'TEXT','sss',NULL,1,'2021-09-25 20:42:48','2021-09-25 20:42:48'),(16,6,12,NULL,'TEXT','chỉnh sửa bố cục',NULL,1,'2021-09-25 21:22:59','2021-09-25 21:22:59'),(17,7,1,NULL,'TEXT','This is a large home, but a little older and has some white balance challenges.  Lots of yellows.  \r\nI also shot it early in the day, so lighting is a challenge. \r\nPay attention to windows and reflections',NULL,1,'2021-09-29 09:02:02','2021-09-29 09:02:02'),(18,7,NULL,9,'TEXT','ok',NULL,1,'2021-09-29 11:27:19','2021-09-29 11:27:19'),(19,7,NULL,9,'IMAGE','uploads/message/2021/09/media_1632889693_7.JPG','AJ9A3642.JPG',1,'2021-09-29 11:28:13','2021